import React from "react";

function LoginLogo() {
  return (
    <div className="grid place-items-center relative ">
      <img
        src="/images/background.svg"
        className="h-full object-cover absolute top-0 z-0"
      />
      <div className="flex flex-col items-center justify-center z-10 px-10 h-screen max-w-[390px] ">
        <div>
          <img src="/images/HigherEducationLogo.svg" />
        </div>
        <p className="text-[40px] text-white mt-3 text-center">PROJECT KARMA</p>
      </div>
    </div>
  );
}

export default LoginLogo;
